const HOST_API = 'http://localhost:8080/api/v1/';

class EmployeeService {

    // funcion asincrona para obtener con fecth la promesa de todos los empleados
    async getEmployees() {
        const response = await fetch(HOST_API + 'employees');
        const employees = await response.json();
        return employees;       
    }

}

export default new EmployeeService();
